import React from 'react';
import { ChakraProvider } from '@chakra-ui/react';
import { BrowserRouter as Router } from 'react-router-dom';
import Login from './components/Login';

function App() {
  return (
    <ChakraProvider>
      <Router basename="/loginseguro">
        <Login />
      </Router>
    </ChakraProvider>
  );
}

export default App;
